import './App.css';
import ChoiceMenu from "./ChoiceMenu";

function App() {
  return (
    <div className="App">
      <h1>Counting Sleep</h1>
      <div className="mainContainer">
        <div className="clockContainer"></div>
        <div className="enteriesContainer">
          <div>
          <div className='itemContainer'>

            <div className={`item`}>
                <p>Check</p>

            </div>
            <ChoiceMenu onDeleteItem={deleteItemHandler} 
                        onEditToggle={toggleEditHandler}
                        />

        </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
